;; **
;;; ## Graph processes and occurrences
;;; 
;;; As explained above, graph production rules are applied to graphs and are used to derive new graphs. This _derivation process_ is called a **graph process** where the nodes represent graphs and the edges represent **occurrences** of graph productions (rule applications).
;;; 
;;; For any graph, we can visualize the graph process it participates in with the `viewproc` form:
;; **

;; @@
(viewproc _)
;; @@
;; =>
;;; {"type":"html","content":"<img src=\"data:image/png;base64,\" width=\"134\" height=\"407\" alt=\"\" />","value":"#object[java.awt.image.BufferedImage 0x2ebdc49d \"BufferedImage@2ebdc49d: type = 6 ColorModel: #pixelBits = 32 numComponents = 4 color space = java.awt.color.ICC_ColorSpace@6f7eb837 transparency = 3 has alpha = true isAlphaPre = false ByteInterleavedRaster: width = 134 height = 407 #numDataElements 4 dataOff[0] = 3\"]"}
;; <=

;; **
;;; If we want a detailed view of the occurrence that led to the derivation of a particular graph, we can use the `viewocc` form:
;; **

;; @@
(viewocc _)
;; @@
;; =>
;;; {"type":"html","content":"<img src=\"data:image/png;base64,\" width=\"277\" height=\"251\" alt=\"\" />","value":"#object[java.awt.image.BufferedImage 0x6f0312fe \"BufferedImage@6f0312fe: type = 6 ColorModel: #pixelBits = 32 numComponents = 4 color space = java.awt.color.ICC_ColorSpace@6f7eb837 transparency = 3 has alpha = true isAlphaPre = false ByteInterleavedRaster: width = 277 height = 251 #numDataElements 4 dataOff[0] = 3\"]"}
