;; **
;;; ## Tagging graphs of interest
;;; 
;;; Identifying graphs by unintelligable labels is inconvenient. Graphs can be tagged with semantic names using the `commit` form. In the following example, we tag the resulting graph with the name "_mygraph_"
;;; 
;;; 
;; **

;; @@
(-> (newgraph) hello world vine)
(commit _ "mygraph")
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-string'>&quot;1f891890-d469-49f5-87a0-aff0f3f87ec2&quot;</span>","value":"\"1f891890-d469-49f5-87a0-aff0f3f87ec2\""}
;; <=

;; **
;;; Once tagged, we can simply call the `graph` form to recall the graph by its semantic name, for example:
;; **

;; @@
(viewgraph (graph "mygraph"))
;; @@
;; =>
;;; {"type":"html","content":"<img src=\"data:image/png;base64,\" width=\"169\" height=\"208\" alt=\"\" />","value":"#object[java.awt.image.BufferedImage 0x401b76b3 \"BufferedImage@401b76b3: type = 5 ColorModel: #pixelBits = 24 numComponents = 3 color space = java.awt.color.ICC_ColorSpace@6f7eb837 transparency = 1 has alpha = false isAlphaPre = false ByteInterleavedRaster: width = 169 height = 208 #numDataElements 3 dataOff[0] = 2\"]"}
;; <=

;; **
;;; ## Rolling back uninteresting derivations
;;; We may want to roll back uninteresting graph derivations, for example to free up resources or to prune graph processes. We can do so by using the `rollback` form. **Warning**: calling rollback will remove all graphs that are not in the history of any _committed_ (tagged) graph.
;;; 
;;; The following example illustrates this behaviour. In the code block below, create a graph process with four different branches, originating from the same empty start graph. We commit a tag for the end-result of one of these derivations.
;; **

;; @@
(def start (newgraph))

(-> start hello world vine)
(-> start hello world vine)
(-> start hello world vine)
(-> start hello world vine)
(commit _ "my graph")
(viewproc start)
;; @@
;; =>
;;; {"type":"html","content":"<img src=\"data:image/png;base64,\" width=\"568\" height=\"407\" alt=\"\" />","value":"#object[java.awt.image.BufferedImage 0x408df8dc \"BufferedImage@408df8dc: type = 6 ColorModel: #pixelBits = 32 numComponents = 4 color space = java.awt.color.ICC_ColorSpace@6f1529d8 transparency = 3 has alpha = true isAlphaPre = false ByteInterleavedRaster: width = 568 height = 407 #numDataElements 4 dataOff[0] = 3\"]"}
;; <=

;; **
;;; Calling `rollback` will remove all graphs that "do not lead up to" a committed (tagged) graph in the graph process. (see below)
;; **

;; @@
(rollback)
(viewproc start)
;; @@
;; =>
;;; {"type":"html","content":"<img src=\"data:image/png;base64,\" width=\"134\" height=\"407\" alt=\"\" />","value":"#object[java.awt.image.BufferedImage 0x71776b43 \"BufferedImage@71776b43: type = 6 ColorModel: #pixelBits = 32 numComponents = 4 color space = java.awt.color.ICC_ColorSpace@6f1529d8 transparency = 3 has alpha = true isAlphaPre = false ByteInterleavedRaster: width = 134 height = 407 #numDataElements 4 dataOff[0] = 3\"]"}
