;; **
;;; ## Starred rule applications
;;; There are often multiple possible matches for any applicable rule. Applying a rule to a graph picks one of them non-deterministally. &&GRAPEpress&& provides a form to explore all of them concurrently. This generates a set of graphs. To illustrate this, let's creat an example graph containing four `Hello` nodes.
;; **

;; @@
(def g4h (-> (newgraph) hello hello hello hello))
(viewgraph g4h)
;; @@
;; =>
;;; {"type":"html","content":"<img src=\"data:image/png;base64,\" width=\"493\" height=\"91\" alt=\"\" />","value":"#object[java.awt.image.BufferedImage 0x251ca8e3 \"BufferedImage@251ca8e3: type = 6 ColorModel: #pixelBits = 32 numComponents = 4 color space = java.awt.color.ICC_ColorSpace@1c474bb5 transparency = 3 has alpha = true isAlphaPre = false ByteInterleavedRaster: width = 493 height = 91 #numDataElements 4 dataOff[0] = 3\"]"}
;; <=

;; **
;;; Calling applying rule `world` will non-deterministically match one of these nodes and produce a new graph with the changes:
;; **

;; @@
(-> g4h world viewgraph)
;; @@
;; =>
;;; {"type":"html","content":"<img src=\"data:image/png;base64,\" width=\"493\" height=\"208\" alt=\"\" />","value":"#object[java.awt.image.BufferedImage 0x9273098 \"BufferedImage@9273098: type = 5 ColorModel: #pixelBits = 24 numComponents = 3 color space = java.awt.color.ICC_ColorSpace@1c474bb5 transparency = 1 has alpha = false isAlphaPre = false ByteInterleavedRaster: width = 493 height = 208 #numDataElements 3 dataOff[0] = 2\"]"}
;; <=

;; **
;;; However, calling a starred rule application will produce a set of graphs, representing all possible derivations. Since the result is a set of graphs, we cannot call `viewgraph` on it, but we can view the graph process.
;; **

;; @@
(def g4h (-> (newgraph) hello hello hello hello))
(world* g4h)
(viewproc g4h)
;; @@
;; =>
;;; {"type":"html","content":"<img src=\"data:image/png;base64,\" width=\"555\" height=\"639\" alt=\"\" />","value":"#object[java.awt.image.BufferedImage 0x2d830735 \"BufferedImage@2d830735: type = 6 ColorModel: #pixelBits = 32 numComponents = 4 color space = java.awt.color.ICC_ColorSpace@1c474bb5 transparency = 3 has alpha = true isAlphaPre = false ByteInterleavedRaster: width = 555 height = 639 #numDataElements 4 dataOff[0] = 3\"]"}
