;; **
;;; # Queries
;;; 
;;; In addition to production rules @@GRAPEpress@@ has graph _queries_, which can be used to query the graph (read only). Since queries do not alter the graph, they do not advance the graph process. Below is a simple example for a query:
;; **

;; @@
(query 'hello? []
	(pattern 
       (node 'h :label "Hello")
       (node 'w :label "World")
       (edge 'e :src 'h :tar 'w :label "to")))
