;;; {"type":"html","content":"<img src=\"data:image/png;base64,\" width=\"153\" height=\"251\" alt=\"\" />","value":"#object[java.awt.image.BufferedImage 0x336d72ac \"BufferedImage@336d72ac: type = 6 ColorModel: #pixelBits = 32 numComponents = 4 color space = java.awt.color.ICC_ColorSpace@493ad6c5 transparency = 3 has alpha = true isAlphaPre = false ByteInterleavedRaster: width = 153 height = 251 #numDataElements 4 dataOff[0] = 3\"]"}
