;; **
;;; # Ferryman
;;; 
;; **

;; @@
(rule 'setup-ferryman
  :create
  (pattern
    (node 'tg :label "Thing" :asserts {:kind "'Goat'"})
    (node 'tc :label "Thing" :asserts {:kind "'Grape'"})
    (node 'tw :label "Thing" :asserts {:kind "'Wolf'"})
    (node 's1 :label "Side" :asserts {:name "'This side'"})
    (node 's2 :label "Side" :asserts {:name "'Other side'"})
    (node 'f  :label "Ferry")
    (edge :label "is_at" :src 'tg :tar 's1)
    (edge :label "is_at" :src 'tc :tar 's1)
    (edge :label "is_at" :src 'tw :tar 's1)
    (edge :label "is_at" :src 'f :tar 's1)
    ))

(rule 'ferry_one_over
  :read
  (pattern :iso
    (node 's1 :label "Side")
    (node 's2 :label "Side")
    (node 'f :label "Ferry")
    (node 't :label "Thing")
    (edge 'et :label "is_at" :src 't :tar 's1)
    (edge 'e :label "is_at" :src 'f :tar 's1))
  :delete ['e 'et]
  :create
  (pattern
    (edge :label "is_at" :src 'f :tar 's2)
    (edge :label "is_at" :src 't :tar 's2)))

(rule 'cross_empty
  :read
  (pattern :iso
    (node 's1 :label "Side")
    (node 's2 :label "Side")
    (node 'f :label "Ferry")
    (edge 'e :label "is_at" :src 'f :tar 's1))
  :delete ['e ]
  :create
  (pattern
    (edge :label "is_at" :src 'f :tar 's2)))

(query 'wolf-can-eat-goat? []
  (pattern :iso
           (node 't1 :label "Thing" :asserts {:kind "'Wolf'"})
           (node 't2 :label "Thing" :asserts {:kind "'Goat'"})
           (node 's :label "Side")
           (node 's2 :label "Side")
           (edge :label "is_at" :src 't1 :tar 's)
           (edge :label "is_at" :src 't2 :tar 's)
           (node 'f :label "Ferry")
           (edge :label "is_at" :src 'f :tar 's2)))

(query 'goat-can-eat-grape? []
  (pattern :iso
           (node 't1 :label "Thing" :asserts {:kind "'Grape'"})
           (node 't2 :label "Thing" :asserts {:kind "'Goat'"})
           (node 's :label "Side")
           (node 's2 :label "Side")
           (edge :label "is_at" :src 't1 :tar 's)
           (edge :label "is_at" :src 't2 :tar 's)
           (node 'f :label "Ferry")
           (edge :label "is_at" :src 'f :tar 's2)))

(query 'all_on_the_other_side? []
  (pattern
           (node 'tg :label "Thing" :asserts {:kind "'Goat'"})
           (node 'tc :label "Thing" :asserts {:kind "'Grape'"})
           (node 'tw :label "Thing" :asserts {:kind "'Wolf'"})
           (node 's2 :label "Side" :asserts {:name "'Other side'"})
           (edge :label "is_at" :src 'tg :tar 's2)
           (edge :label "is_at" :src 'tc :tar 's2)
           (edge :label "is_at" :src 'tw :tar 's2)))


;; @@
;; =>
;;; {"type":"html","content":"<img src=\"data:image/png;base64,\" width=\"429\" height=\"277\" alt=\"\" />","value":"#object[java.awt.image.BufferedImage 0x19ca6a89 \"BufferedImage@19ca6a89: type = 5 ColorModel: #pixelBits = 24 numComponents = 3 color space = java.awt.color.ICC_ColorSpace@720beeb4 transparency = 1 has alpha = false isAlphaPre = false ByteInterleavedRaster: width = 429 height = 277 #numDataElements 3 dataOff[0] = 2\"]"}
;; <=

;; @@
(def start (-> (newgraph) setup-ferryman))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;user/start</span>","value":"#'user/start"}
;; <=

;; @@
(defn solveFMP []
  (loop [gs (list (-> (newgraph) setup-ferryman))]
    (let [solutions (filter #(not (empty? (all_on_the_other_side?  %))) gs)]
      (if (empty? solutions)
        (let [safeGs (filter #(and (empty? (wolf-can-eat-goat? %))
                                   (empty? (goat-can-eat-grape? %))) gs)]
          (recur (flatten
                  (concat
                   (map ferry_one_over* safeGs)
                   (map cross_empty* safeGs)))))
        (commit (first solutions) "solution")))))
            
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;user/solveFMP</span>","value":"#'user/solveFMP"}
